import React from 'react';

import { QuantitySelector } from "./components/QuantitySelector"

import './App.css';


function App() {
  console.log("hirtd")
  return (
    <div className="App">
      <h1>Battery Configurator</h1>
      <table>
      <thead>
        <tr>
          <th>Device Name</th>
          <th>Floor Dimension</th>
          <th>Energy</th>
          <th>Cost</th>
          <th>Release Date</th>
        </tr>
      </thead>
      <tbody>
        {data.map((item, index) => (
          <tr key={index}>
            <td>{item.deviceName}</td>
            <td>{item.floorDimension}</td>
            <td>{item.energy}</td>
            <td>{item.cost}</td>
            <td>{item.releaseDate}</td>
          </tr>
        ))}
      </tbody>
    </table>

      {/* <QuantitySelector /> */}
    </div>
  );
}

export default App;
